import React, {useEffect, useState} from 'react';

function App(){
  // init variable for data from backend
  const [backendData, setBackendData] = useState([{}])

  // retreiving data from backend api

  useEffect(() => {
    fetch("/api").then(
      response => response.json()
    ).then(
      // setting const data variable from retrived data
      data => {
        setBackendData(data)
      }
    )
  }, [])

  return(
    <div id = "root">
      <div data-reactroot>
        <h1> Enter a Number: </h1>
      <h2>
        <form>
          <label>
            <input type ="text" name ="number" />
          </label>
          <input type="submit" value= "Submit" />
        </form>
      </h2>
      </div>
    </div>

  )
}

export default App
